import React from 'react';
import { getCardImage } from '../utils/deckUtils';

function Card({ card }) {
  const cardImage = getCardImage(card);

  return (
    <div className="card">
      <div className={`card-face ${card.suit}`}>
        <img src={cardImage} alt={`${card.value} of ${card.suit}`} />
      </div>
    </div>
  );
}

export default Card;
